if($('.expand-sm').length){$('.navbar').attr('data-toggle',breakPoint.sm)}else if($('.expand-md').length){$('.navbar').attr('data-toggle',breakPoint.md)}else if($('.expand-lg').length){$('.navbar').attr('data-toggle',breakPoint.lg)}else if($('.expand-xl').length){$('.navbar').attr('data-toggle',breakPoint.xl)}
